{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/atr516/bellabeat-data-analysis-capstone-project?scriptVersionId=204680067\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"177efdd6","metadata":{"papermill":{"duration":0.012796,"end_time":"2024-11-01T13:40:59.995339","exception":false,"start_time":"2024-11-01T13:40:59.982543","status":"completed"},"tags":[]},"source":["# Introduction"]},{"cell_type":"markdown","id":"77fe0925","metadata":{"papermill":{"duration":0.011962,"end_time":"2024-11-01T13:41:00.019963","exception":false,"start_time":"2024-11-01T13:41:00.008001","status":"completed"},"tags":[]},"source":["This is the capstone project for the Google Data Analytics Certificate"]},{"cell_type":"markdown","id":"369d3969","metadata":{"papermill":{"duration":0.013378,"end_time":"2024-11-01T13:41:00.046403","exception":false,"start_time":"2024-11-01T13:41:00.033025","status":"completed"},"tags":[]},"source":["#  Scenario "]},{"cell_type":"markdown","id":"264789ca","metadata":{"papermill":{"duration":0.013115,"end_time":"2024-11-01T13:41:00.071053","exception":false,"start_time":"2024-11-01T13:41:00.057938","status":"completed"},"tags":[]},"source":["I am a junior data analyst working in the marketing analytics team at Bellabeat, a high-tech manufacturer of health-focused products for women. They are a small successful company with the potential to become a large player in the global smart device market. I have been tasked to focus on one of Bellabeat’s products; Bellabeat app and analyze smart device fitness data to gain insights into how customers use their smart devices. The insights gained from my analysis will help guide Bellabeat’s marketing strategy. I will present my findings and recommendations to Bellabeat executive team."]},{"cell_type":"markdown","id":"88cd8ab5","metadata":{"papermill":{"duration":0.011862,"end_time":"2024-11-01T13:41:00.095656","exception":false,"start_time":"2024-11-01T13:41:00.083794","status":"completed"},"tags":[]},"source":["# Stakeholders"]},{"cell_type":"markdown","id":"17b4455d","metadata":{"papermill":{"duration":0.01282,"end_time":"2024-11-01T13:41:00.120665","exception":false,"start_time":"2024-11-01T13:41:00.107845","status":"completed"},"tags":[]},"source":["**Urška Sršen:** Bellabeat's co-founder and Chief Creative Officer\n","\n","**Sando Mur:** Mathematician and Bellabeat's co-founder; key member of Bellabeat executive team.\n","\n","**BellaBeat's Marketing Analytics Team:** A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy. I joined this team six months ago and have been busy learning about Bellabeat’s mission and business goals — as well as how I, as a junior data analyst, can help Bellabeat achieve them."]},{"cell_type":"markdown","id":"1ba6941f","metadata":{"papermill":{"duration":0.01252,"end_time":"2024-11-01T13:41:00.145485","exception":false,"start_time":"2024-11-01T13:41:00.132965","status":"completed"},"tags":[]},"source":["# Products"]},{"cell_type":"markdown","id":"84418d91","metadata":{"papermill":{"duration":0.011686,"end_time":"2024-11-01T13:41:00.171019","exception":false,"start_time":"2024-11-01T13:41:00.159333","status":"completed"},"tags":[]},"source":["**Bellabeat app:** The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","**Leaf:** Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","**Time:** This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","**Spring:** This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels."]},{"cell_type":"markdown","id":"00ea7ee7","metadata":{"papermill":{"duration":0.012302,"end_time":"2024-11-01T13:41:00.195034","exception":false,"start_time":"2024-11-01T13:41:00.182732","status":"completed"},"tags":[]},"source":["# About the Company"]},{"cell_type":"markdown","id":"7a0d02ae","metadata":{"papermill":{"duration":0.01251,"end_time":"2024-11-01T13:41:00.220909","exception":false,"start_time":"2024-11-01T13:41:00.208399","status":"completed"},"tags":[]},"source":["Bellabeat, a high-tech manufacturer of health-focused products for women. Although, a successful small company, they have the potential to become a larger player in the global smart device market. Urška Sršen and Sando Mur founded Bellabeat. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the world. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women."]},{"cell_type":"markdown","id":"226089ac","metadata":{"papermill":{"duration":0.011571,"end_time":"2024-11-01T13:41:00.243991","exception":false,"start_time":"2024-11-01T13:41:00.23242","status":"completed"},"tags":[]},"source":["**How can a wellness company play it smart?**"]},{"cell_type":"markdown","id":"b0a94927","metadata":{"papermill":{"duration":0.016566,"end_time":"2024-11-01T13:41:00.272354","exception":false,"start_time":"2024-11-01T13:41:00.255788","status":"completed"},"tags":[]},"source":["# Ask"]},{"cell_type":"markdown","id":"27250ab0","metadata":{"papermill":{"duration":0.012489,"end_time":"2024-11-01T13:41:00.297775","exception":false,"start_time":"2024-11-01T13:41:00.285286","status":"completed"},"tags":[]},"source":["The objective is to analyze current consumer usage of non-Bellabeat smart devices and compare it with usage patterns of similar Bellabeat products. By identifying trends in smart device usage, with a specific focus on a selected Bellabeat product, the goal is to develop strategic recommendations. These insights will inform improvements to Bellabeat’s marketing strategy, ensuring it effectively meets consumer needs and preferences.\n","\n","The key stakeholders for this projects are the cofounders, Urška Sršen and Sando Mur, and the marketing analytics team.\n","\n","Questions to explore:\n","\n","What are some trends in the consumer smart device usage?\n","\n","What could these trends tell us about Bellabeat customers?\n","\n","Using the trends and insights gained, what are some recommendations for Bellabeat’s future marketing strategies?"]},{"cell_type":"markdown","id":"e19df6e6","metadata":{"papermill":{"duration":0.012673,"end_time":"2024-11-01T13:41:00.322968","exception":false,"start_time":"2024-11-01T13:41:00.310295","status":"completed"},"tags":[]},"source":["# Prepare"]},{"cell_type":"markdown","id":"78c4394a","metadata":{"papermill":{"duration":0.012154,"end_time":"2024-11-01T13:41:00.346648","exception":false,"start_time":"2024-11-01T13:41:00.334494","status":"completed"},"tags":[]},"source":["The data source used for our case study is FitBit Fitness Tracker Data. This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03/12/2016 and 05/12/2016. It is stored in Kaggle and was made available through Möbius. It is an open data so it is accessible to the public. It was collected with consent as a part of the survey so we can say that the data is credible\n","\n","There are 18 CSV documents made available for the analysis. Each document represents different quantitative data tracked by Fitbit. The data is considered long since each row is one time point per subject, so each subject will have data in multiple rows. Every user has a unique ID and different rows since data is tracked by day and time.\n"]},{"cell_type":"markdown","id":"9373dcf8","metadata":{"papermill":{"duration":0.011905,"end_time":"2024-11-01T13:41:00.370602","exception":false,"start_time":"2024-11-01T13:41:00.358697","status":"completed"},"tags":[]},"source":["To prepare the data we will need to start installing and loading the packages first:"]},{"cell_type":"code","execution_count":1,"id":"4fa4c7d7","metadata":{"execution":{"iopub.execute_input":"2024-11-01T13:41:00.400074Z","iopub.status.busy":"2024-11-01T13:41:00.397762Z","iopub.status.idle":"2024-11-01T13:42:01.995368Z","shell.execute_reply":"2024-11-01T13:42:01.993499Z"},"papermill":{"duration":61.616015,"end_time":"2024-11-01T13:42:01.998449","exception":false,"start_time":"2024-11-01T13:41:00.382434","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]},{"name":"stderr","output_type":"stream","text":["Warning message:\n","“unable to access index for repository http://cran.rstudio.com/src/contrib:\n","  cannot open URL 'http://cran.rstudio.com/src/contrib/PACKAGES'”\n"]},{"name":"stderr","output_type":"stream","text":["Warning message:\n","“package ‘tidyverse’ is not available for this version of R\n","\n","A version of this package for your version of R might be available elsewhere,\n","see the ideas at\n","https://cran.r-project.org/doc/manuals/r-patched/R-admin.html#Installing-packages”\n"]},{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.5