() %>%\n","     summarise(mean_total_int = mean(TotalIntensity))\n","   # Create a bar plot for average total intensity vs. time\n","    ggplot(data = hourly_intensities,   aes(x = time, y = mean_total_int)) + geom_histogram(stat = \"identity\", fill='993366') +\n","     theme(axis.text.x = element_text(angle = 90)) +\n","     labs(x = \"Time\", y = \"Average Total Intensity\", title=\"Average Total Intensity vs. Time\")"]},{"attachments":{"1b660ea0-4317-4e43-8ca7-f663eb2ffda6.png":{"image/png":""}},"cell_type":"markdown","id":"0f1502af","metadata":{"papermill":{"duration":0.027439,"end_time":"2024-11-01T13:42:08.377609","exception":false,"start_time":"2024-11-01T13:42:08.35017","status":"completed"},"tags":[]},"source":["![Average Total Insenity vs Time.png](attachment:1b660ea0-4317-4e43-8ca7-f663eb2ffda6.png)"]},{"cell_type":"markdown","id":"c8e6e967","metadata":{"papermill":{"duration":0.027594,"end_time":"2024-11-01T13:42:08.432152","exception":false,"start_time":"2024-11-01T13:42:08.404558","status":"completed"},"tags":[]},"source":["* People are generally active between 5pm to 9pm\n","* The most intense hours of the day were between 6pm and 8pm. This can be attributed to evening workout routines after the day's work.\n"]},{"cell_type":"markdown","id":"78770687","metadata":{"papermill":{"duration":0.028355,"end_time":"2024-11-01T13:42:08.488009","exception":false,"start_time":"2024-11-01T13:42:08.459654","status":"completed"},"tags":[]},"source":["# Act"]},{"cell_type":"markdown","id":"405cb81b","metadata":{"papermill":{"duration":0.027059,"end_time":"2024-11-01T13:42:08.541728","exception":false,"start_time":"2024-11-01T13:42:08.514669","status":"completed"},"tags":[]},"source":["**Based on this information, these are the recommendations that I would give:**\n","*  Most users are close to reaching the daily step goal of 10,000 steps so you should encourage them to reach this goal. This can be done by creating challenges or rewards for achieving this goal consistently.\n","* Promote short, high-intensity workout sessions to help users increase their very active minutes. Offering quick workout routines within the app could engage users who currently have low activity levels.\n","* Introduce reminders or prompts to stand up and move around after long periods of inactivity. This could help users break up their sedentary time throughout the day, especially from 11:00 AM to 19:00 PM, when people usually take the most amount of steps\n","* Different people have different sleep durations so give them personalized sleep improvement tips or bedtime routines within the app to help them achieve more consistent and better sleep.\n","* Offer customer fitness plans that match the current activity levels of the user and encourage gradual progress based on calorie burn and activity levels.\n","* Use motivational messages and achievements to encourage consistent activity and engagement, helping users feel rewarded for their efforts even on less active days.\n"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":7746251,"sourceType":"datasetVersion"},{"datasetId":5654206,"sourceId":9331743,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":72.273355,"end_time":"2024-11-01T13:42:08.693464","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-11-01T13:40:56.420109","version":"2.6.0"}},"nbformat":4,"nbformat_minor":5}